        onChange={e=>console.log(e.target.value)}
      ></TextField>
        )
    }

    let age


    const SelectTemplate = () => {
        return(
            <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={age}
            label="Age"
            onChange={console.log(e => console.log(e.target.value))}
          >
            <MenuItem value={10}>Ten</MenuItem>
